Run คำสั่ง check connection ด้วย module ชื่อ ping ansible localhost -m ping โดยคำสั่ง ansible localhost -h ping เป็นการใช้ทดสอบ connectivity ไปยัง localhost สามารถแยกคำสั่งได้ดังนี้ ansible: เครื่องมือบรรทัดคำสั่งสำหรับการรันคำสั่ง ad-hoc ด้วย Ansible localhost: โฮสต์เป้าหมายสำหรับคำสั่ง Ansible ในกรณีนี้คือเครื่องของเราเอง -m ping: ตัวเลือก -m ใช้เพื่อระบุโมดูลที่ต้องการใช้ โดย ping เป็นโมดูลง่ายๆ ของ Ansible ที่ตรวจสอบว่าเป้าหมายสามารถเข้าถึงได้หรือไม่ Result localhost | SUCCESS => { "changed": false, "ping": "pong"
} ซึ่งหมายความว่าโมดูล ping ได้ทำการติดต่อกับ localhost สำเร็จ และได้รับการตอบกลับเป็น "pong" แสดงว่าการเชื่อมต่อนั้นดี หากมีข้อผิดพลาด ข้อความที่แสดงจะช่วยให้คุณสามารถวิเคราะห์ปัญหาได้ครับ Run คำสั่ง ด้วย module command เพื่อส่งคำสั่งที่เราต้องการ ไปทำงาน ใน server เป้าหมาย [vagrant@centos9s ~]$ ansible localhost -m command -a "uptime"
localhost | CHANGED | rc=0 >> 13:51:41 up 33 min, 1 user, load average: 0.08, 0.05, 0.08 ผลลัพธ์ที่ได้จากคำสั่งนี้จะเป็นการแสดงระยะเวลาที่เครื่องทำงานมาตั้งแต่การเริ่มต้นเครื่อง รายละเอียด คำสั่ง: ansible localhost -m command -a "uptime" ทำงานดังนี้: ansible: เครื่องมือบรรทัดคำสั่งสำหรับการรันคำสั่ง ad-hoc ด้วย Ansible localhost: โฮสต์เป้าหมายที่คำสั่ง Ansible จะถูกส่งไป ซึ่งในกรณีนี้คือตัวเครื่องของคุณเอง -m command: ตัวเลือก -m ใช้เพื่อระบุโมดูลที่ต้องการใช้ ในที่นี้คือโมดูล command ซึ่งใช้สำหรับรันคำสั่งทั่วไป -a "uptime": ตัวเลือก -a ใช้เพื่อระบุพารามิเตอร์ของโมดูล ในที่นี้คือคำสั่ง uptime ซึ่งจะแสดงระยะเวลาที่เครื่องทำงานอยู่

